DESCRIPT_HAB_FIELD:
Régions OSPAR où l'habitat est présent. 
Les régions OSPAR sont les suivantes : 
I - Arctique : la zone maritime OSPAR qui s’étend au nord du 62° de latitude nord, mais qui comporte également l’Islande et les îles Féroé ; 
II - Mer du Nord au sens large : la mer du Nord, la Manche, le Skagerrak et le Kattegat jusqu’aux limites de la zone maritime OSPAR, bordée au nord par le 62°de latitude nord, à l’ouest par le 5°de longitude ouest et la côte est de la Grande-Bretagne, et au sud par le 48°de latitude nord ; 
III - Mers celtiques : bordées à l’est par le 5° de longitude ouest et la côte ouest de la Grande-Bretagne et à l’ouest par l’isobare de 200m (contour de profondeur) à l’ouest du 6° de longitude ouest le long des côtes ouest de l’Ecosse et de l’Irlande ; 
IV - Golfe de Gascogne et côtes ibériques : région située au sud du 48°de latitude nord, à l’est du 11°de longitude ouest et au nord du 36°de latitude nord (la limite méridionale de la zone maritime OSPAR) ; 
V - l’Atlantique au large : le reste de la zone maritime OSPAR. 
Source : 2008-6.
